import React, { createElement } from "react";
import './celula.css'

export function Celula({text}) {

    function celulaClick(){
        let cell = document.getElementById("celula")
        cell.classList.add("selecionado")
    }

    return (
        <div className="celula" id="celula" onClick={celulaClick}><p>{text}</p></div>
        
    )
}
